import React from "react";
import { ExpandMore } from "@mui/icons-material";
import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Typography,
} from "@mui/material";

export default function Group({ group, updateGroup }) {
  return (
    <Accordion
      expanded={group.expanded}
      onChange={(e, expanded) => updateGroup({ ...group, expanded })}
    >
      <AccordionSummary expandIcon={<ExpandMore />}>
        {group.name}
      </AccordionSummary>
      <AccordionDetails>
        <Typography variant="h3" align="center">
          {group.count[group.next - 1]}
        </Typography>
      </AccordionDetails>
    </Accordion>
  );
}
